-- 用户模块开始
CREATE database vipShop DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;
use vipShop;
-- 用户表
create table users(
    id int unsigned auto_increment primary key not null comment '用户 id',
    phone char(11) not null comment '用户 手机',
    password varchar(255) comment '用户 密码',
    mail varchar(255) comment '用户 邮箱',
    username varchar(255) comment '用户名',
    avatar varchar(255) not null default '/default.png' comment '用户头像',
    verifyCode varchar(6) not null comment '短信验证码'
);

-- 商品浏览历史表
create table goods_browse(
    id int unsigned primary key auto_increment not null comment '商品浏览 id',
    users_id int unsigned not null comment '用户 id',
    goods_id int unsigned not null comment '商品 id'
);

-- 商品收藏
create table goods_collect(
    id int unsigned primary key auto_increment not null comment '商品收藏表 id',
    users_id int unsigned not null comment '用户 id',
    goods_id int unsigned not null comment '商品 id'
);


-- 购物车历史记录表，当在购物车中的商品被移除时加入到购物车历史记录表中
create table cart_collect(
    id int unsigned primary key auto_increment not null comment '购物车 id',
    users_id int unsigned not null comment '用户 id',
    goods_id int unsigned not null comment '商品 id',
    goods_name varchar(50) not null comment '商品 名称',
    goods_img varchar(255) not null comment '商品 图片',
    price decimal(11, 2) not null comment '商品 价格',
    attr_name varchar(20) comment '规格',
    val_name varchar(20) comment '值'
);


-- 用户模块结束








-- 分类模块开始

-- 一级分类
create table categories(
    id int unsigned auto_increment primary key not null comment '一级分类 id',
    cname varchar(255) not null comment '一级分类 名称',
    link varchar(255) comment '一级分类 路由的相对url地址',
    img varchar(255) comment '分类图片',
    imgs varchar(255) comment '小图片',
    imgss varchar(255) comment '大图片'
);


-- 二级分类
create table sub_Categories(
    id int unsigned auto_increment primary key not null comment '二级分类 id',
    parent_id int unsigned not null comment '一级分类 id',
    snmae varchar(255) not null comment '二级分类 名称',
    link varchar(255) comment '二级分类 路由的相对url地址',
    img varchar(255) comment '分类图片'
);
























-- 三级分类
create table sub_sub_Categories(
    id int unsigned auto_increment primary key not null comment '三级分类 id',
    parent_id int unsigned not null comment '二级分类 id',
    snmae varchar(255) not null comment '三级分类 名称',
    link varchar(255) comment '三级分类 路由的相对url地址',
    img varchar(255) comment '图片'
);
