-- 商品表
create table goods(
    id int unsigned auto_increment primary key not null comment '商品 id',
    goods_name varchar(255) not null comment '商品 名称',
    goods_desc text comment '商品描述',
    goods_img varchar(150) not null  comment '商品 主图',
    scate_id int unsigned not null comment '三级分类 id，通过查询三级分类下的全部商品取前9个推荐商品的品牌为当期分类下的推荐品牌',
    before_price decimal(11, 2) not null comment '原价',
    price decimal(11, 2) not null default 0.00 comment '现价',
    discount decimal(11, 2) comment '折扣',
    warn_stock int not null default 0 comment '预警 库存，默认为0',
    stock int not null default 0 comment '库存',
    isSale tinyint(4) not null default 1 comment '0下架 1上架，默认上架, 是否上架',
    isBest tinyint(4) not null default 0 comment '0否 1是,默认否,是否精品',
    isHot tinyint(4) not null default 0 comment '0否，1是，默认否,是否热销',
    isNew tinyint(4) not null default 0 comment '0否 1是,默认为否，是否新品',
    isRecom tinyint(4) not null default 0 comment '0否 1是,默认否，是否推荐',
    isDiscount tinyint(4) not null default 0 comment '0否 1是，默认否,是否折后价',
    isRobPrice tinyint(4) not null default 0 comment '0否 1是，默认否,是否疯抢价',
    goods_detail text comment '商品图文详情,富文本编辑存储',
    goods_introduce text comment '商品介绍,json格式,键值对'
);
