-- 商品规格属性表
create table goods_spec_attr(
    id int unsigned primary key auto_increment not null comment '属性 id',
    goods_id int unsigned not null comment '商品 id',
    attr_name varchar(20) not null comment '属性 名称'
);


-- 商品规格值表,每个值对应着五张图片
create table goods_spec_val(
    id int unsigned primary key auto_increment not null comment '属性值 id',
    attr_id int unsigned not null comment '属性 id',
    val_name varchar(20) not null comment '值',
    img varchar(255) comment '值 图片'
);
-- 商品模块结束
-- 订单模块


-- 购物车
create table carts(
    id int unsigned auto_increment primary key not null comment '购物车 id',
    users_id int unsigned not null comment '用户 id',
    goods_id int unsigned not null comment '商品 id',
    isCheck tinyint(4) unsigned not null default 0 comment '0否 1是,是否选中，默认否',
    cart_count int unsigned not null default 1 comment '购买数量',
    goods_name varchar(255) not null comment '商品 名称',
    goods_desc text comment '商品描述',
    before_price decimal(11, 2) not null comment '原价',
    price decimal(11, 2) not null default 0.00 comment '现价',
    goods_img varchar(150) not null  comment '商品图片'
);



-- 收货地址列表
create table user_address(
    id int unsigned primary key auto_increment not null comment '地址 id',
    users_id int unsigned not null comment '用户id',
    deliver_name varchar(255) not null comment '收货人名称',
    phone char(11) not null comment '手机号',
    deliver_time tinyint(6) not null default 0 comment '收货时间,默认不限, 0不限，1周六周日，2周一至周五',
    province varchar(12) not null  comment '省',
    city varchar(12) not null comment '城市',
    county varchar(12) not null comment '县',
    street varchar(255) not null comment '街道',
    detail varchar(255) comment '详细地址' 
);




-- 订单表
create table `order`(
    id int unsigned primary key auto_increment not null comment '订单 id',
    users_id int unsigned not null comment '用户 id',
    order_sn varchar(14) not null comment '订单编号，年月日各两位和8位随机数，如19年11月19日时间 和8位随机数 240645688，生成订单号为19111924064568',
    order_status tinyint(4) not null default 0 comment '订单状态， 0：待付款，1：待发货(支付完成时)，2：待收货(发出快递），3：订单完成(用户收货并确认收货),4订单关闭',
    create_time int unsigned not null comment '下单时间戳,提醒：int最大10位',
    deliver_name varchar(255) not null comment '收货人 名称',
    phone char(11) not null comment '手机号',
    deliver_time tinyint(6) not null default 0 comment '收货时间,默认不限, 0不限，1周六周日，2周一至周五',
    province varchar(12) not null  comment '省',
    city varchar(12) not null comment '城市',
    county varchar(12) not null comment '县',
    street varchar(12) not null comment '街道',
    detail varchar(255) not null comment '详细地址',
    total_price decimal(11, 2) not null comment '总价',
    post_order_sn varchar(255) comment '快递号'
);

-- 订单商品表
create table order_goods(
    id int unsigned primary key auto_increment not null comment '订单商品 id',
    order_id int unsigned not null comment '订单 id',
    goods_id int unsigned not null comment '商品 id',
    buy_count tinyint(3) not null comment '购买的数量, 最大能买200个',
    goods_img varchar(255) not null comment '商品 图片地址',
    goods_name varchar(255) not null comment '商品 名称',
    before_price decimal(11, 2) not null comment '之前价格',
    price decimal(11, 2) not null comment '价格'
);
